import './App.css';
import Home from './Components/Home/Home'; // Correct the path if 'Componants' is a typo
import 'bootstrap/dist/css/bootstrap.min.css';
import NavBar from './Components/Home/Header/NavBar'; // Correct the path if 'Componants' is a typo
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import ProductDetailsView from './Components/DetailView/ProductDetailView'; // Correct the path if 'Componants' is a typo
import Cart from './Components/AddToCart/Cart'; // Correct the path if 'Componants' is a typo
import BuyNowContainer from './Components/BuyNow/BuyNowContainer'; // Correct the path if 'Componants' is a typo
import { DataProvider } from './Components/ContextApi/DataProvider'; // Correct the path if 'Componants' is a typo

function App() {
    return (
        <div className="App">
            <BrowserRouter>
                <NavBar />
                <DataProvider>
                    <Routes>
                        <Route path="/" element={<Home />} />
                        <Route
                            path="/product/:id"
                            element={<ProductDetailsView />}
                        />
                        <Route path="/cart" element={<Cart />} />
                        <Route
                            path="/place-order"
                            element={<BuyNowContainer />}
                        />
                    </Routes>
                </DataProvider>
            </BrowserRouter>
        </div>
    );
}

export default App;
